import React from 'react'

/*
class ShopList extends React.Component {
	render() {
		return (
			<div>
				{shops.map((shop) => (
					<span>{shop.name}</span>
				))}
			</div>
		)
	}
}
*/


const ShopList = ({ shops }) => (
  <div>
    {shops.map(shop => (
      <span>{shop.name}</span>
    ))}
  </div>
)


export default ShopList
